import { db } from "../firebaseConfig";
import "firebase/firestore";
import React from "react";

function Test1() {
    return (
        <div>
            {db
                .collection("products")
                .get()
                .then((res) => {
                    res.forEach((doc) => <div>{doc.data().name}</div>);
                })}
        </div>
    );
}

export default Test1;
